import React, { Component } from 'react';
import { Modal, Button } from 'antd';

export default class BtnAddWorkSchedule extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isVisible: false
    }
  }

  setModalVisible(isVisible) {
    this.setState({ isVisible });
  }

  onOK() {
    console.log('OK');
    this.setModalVisible(false);
  }

  onCancel() {
    console.log('Cancel');
    this.setModalVisible(false);
  }

  render() {
    return (
      <div>
        <Button type="primary" onClick={() => this.setModalVisible(true) } >
          Add Work Schedule
        </Button>
        <Modal
          title="Vertically centered modal dialog"
          centered
          visible={this.state.isVisible}
          onOk={() => this.onOK()}
          onCancel={() => this.onCancel()}
        >
          <p>some contents...</p>
          <p>some contents...</p>
          <p>some contents...</p>
        </Modal>
      </div>
    )
  }
}
